import React from 'react'
import { Link } from 'react-router-dom'
import './index';

const Dashboard = () => {
  return (
    <div>
      <center>
        <h3>Welcome to dashboard page</h3>
        <Link to='/'>Home</Link>
      </center>
    </div>
  )
}

export default Dashboard
